import React, { useState, useEffect } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import axios from "axios";
import Navbar from "../homepage/Navbar";

const API_URL = "http://127.0.0.1:8000/api/resale/raw_data_by_town";

const townOptions = [
    "ANG MO KIO", "BEDOK", "BISHAN", "BUKIT BATOK", "BUKIT MERAH",
    "BUKIT PANJANG", "BUKIT TIMAH", "CENTRAL AREA", "CHOA CHU KANG", "CLEMENTI"
];
const roomTypeOptions = [
    "1 ROOM", "2 ROOM", "3 ROOM", "4 ROOM", "5 ROOM", "EXECUTIVE", "MULTI-GENERATION"
];
const yearOptions = [2017, 2018, 2019, 2020, 2021, 2022, 2023, 2024, 2025];

const SearchResults = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const searchParams = new URLSearchParams(location.search);

    const [district, setDistrict] = useState(searchParams.get("district") || "");
    const [startYear, setStartYear] = useState(searchParams.get("startYear") || "");
    const [endYear, setEndYear] = useState(searchParams.get("endYear") || "");
    const [roomType, setRoomType] = useState(searchParams.get("roomType") || "");
    const [sortOrder, setSortOrder] = useState("asc");
    const [filteredResults, setFilteredResults] = useState([]);
    const [selectedListing, setSelectedListing] = useState(null);
    const [loading, setLoading] = useState(false);

    useEffect(() => {
        if (district && startYear && endYear) {
            fetchData();
        }
    }, []);

    const fetchData = () => {
        setLoading(true);
        const params = new URLSearchParams();
        params.append("town", district);
        params.append("start_month", `${startYear}-01`);
        params.append("end_month", `${endYear}-12`);

        axios
            .get(`${API_URL}?${params.toString()}`)
            .then((res) => {
                let results = res.data;
                if (roomType) {
                    results = results.filter(item => item.room_type === flatType);
                }

                results.sort((a, b) =>
                    sortOrder === "asc"
                        ? a.resale_price - b.resale_price
                        : b.resale_price - a.resale_price
                );

                setFilteredResults(results);
            })
            .catch((err) => {
                console.error("❌ Error fetching data:", err);
                setFilteredResults([]);
            })
            .finally(() => setLoading(false));
    };

    const handleKeyPress = (e) => {
        if (e.key === "Enter") fetchData();
    };

    return (
        <div className="min-h-screen bg-gray-100 text-red-900">
            <Navbar />
            <div className="max-w-5xl mx-auto mt-10 px-6">
                <h1 className="text-4xl font-bold text-center mb-10">🏠 HDB Past Listings</h1>

                <div className="bg-white p-6 shadow-md rounded-lg mb-10">
                    <h2 className="text-xl font-semibold mb-3">🔎 Filter Listings</h2>
                    <div className="flex flex-wrap gap-4 items-center">

                        {/* Dropdown for Town */}
                        <select value={district} onChange={(e) => setDistrict(e.target.value)} className="border px-4 py-2 rounded-lg w-64">
                            <option value="">Select District</option>
                            {townOptions.map(town => <option key={town} value={town}>{town}</option>)}
                        </select>

                        {/* Dropdown for Flat Type */}
                        <select value={roomType} onChange={(e) => setRoomType(e.target.value)} className="border px-4 py-2 rounded-lg w-64">
                            <option value="">All Room Types</option>
                            {roomTypeOptions.map(type => <option key={type} value={type}>{type}</option>)}
                        </select>

                        {/* Dropdown for Start Year */}
                        <select value={startYear} onChange={(e) => setStartYear(e.target.value)} className="border px-4 py-2 rounded-lg w-32">
                            <option value="">Start Year</option>
                            {yearOptions.map(year => <option key={year} value={year}>{year}</option>)}
                        </select>

                        {/* Dropdown for End Year */}
                        <select value={endYear} onChange={(e) => setEndYear(e.target.value)} className="border px-4 py-2 rounded-lg w-32">
                            <option value="">End Year</option>
                            {yearOptions.map(year => <option key={year} value={year}>{year}</option>)}
                        </select>

                        {/* Sort Order */}
                        <select value={sortOrder} onChange={(e) => setSortOrder(e.target.value)} className="border px-4 py-2 rounded-lg">
                            <option value="asc">Sort by Price: Low to High</option>
                            <option value="desc">Sort by Price: High to Low</option>
                        </select>

                        <button onClick={fetchData} className="px-6 py-2 bg-red-600 text-white font-bold rounded-lg shadow-lg hover:bg-red-700 transition-all">
                            ✅ Apply Filter
                        </button>
                    </div>
                </div>

                {/* Results Table & Modal... (unchanged) */}
            </div>
        </div>
    );
};

export default SearchResults;
